import React from 'react';
import Logo from './Logo';
import BestPokemon from './Logo';

function App() {
	return (
		<div>
			<Logo />
			<BestPokemon />
			<CaughtPokemon />
		</div>
	);
}



let CaughtPokemon = () => {
	let date = new Date().toLocaleDateString();
	return <p>Caught 0 Pokemon on {date}</p>;
};


export default App;
